import React from 'react';

let Users = (props) => {
    return <div>
        {
            props.users.map( u => <div key = {u.id}>
                <span>
                    <img src = {u.avatar}/>
                    { u.followed? <button>Unfollow</button> :<button>Unfollow</button> }
                </span>
                <span>
                    <span>
                        <div>{u.fullName}</div>
                    </span>
                    <span>
                        <div>{u.location.country}</div>
                        <div>{u.location.city}</div>
                    </span>
                </span>
                </div>)
        }
    </div>
}

export default Users;
